description:
Verenigde Staten
Misdaad / Komedie
108 minuten

goed

met Sean Bean, Chris Hemsworth en Victoria Profeta

Het financieel worstelende jonge stel, Sam en Leslie, denken dat hun geluk een definitieve draai heeft gekregen, wanneer ze een 
koffer vol met geld vinden. Maar hun blijheid verandert snel in een dodelijk spel, wanneer de sinistere crimineel Pyke Kubic wil 
komen halen wat ze gevonden hebben.
